import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the mobile menu trigger (nav-menu) and click it to open the mobile menu
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Screenshot after opening mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Wait for the mobile menu itself to be visible
    await page.waitForSelector('.mobile-menu', { timeout: 5000 });

    // Extract visible navigation links from the mobile menu
    const mobileMenuLinks = await page.$$eval('.mobile-menu a', els =>
      els.filter(e => e.offsetParent !== null).map(e => e.textContent.trim()).filter(Boolean)
    );

    // Click the "Electronics" link in the mobile menu (first occurrence)
    const electronicsLink = await page.$('.mobile-menu a:text("Electronics")');
    if (electronicsLink) {
      await electronicsLink.click();
    } else {
      // Fallback: try XPath for "Electronics"
      const [el] = await page.$x("//div[contains(@class,'mobile-menu')]//a[contains(text(),'Electronics')]");
      if (el) await el.click();
    }

    // Wait for main content to update to Electronics category
    await page.waitForSelector('h2', { timeout: 5000 });
    const categoryHeader = await page.$eval('h2', el => el.textContent.trim());

    // Screenshot after navigating to Electronics
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_category.png'));

    // Reopen mobile menu to test close button
    await page.click('.nav-menu');
    await page.waitForSelector('#mobileMenuOverlay.show', { timeout: 5000 });

    // Wait for close button in mobile menu and click it
    await page.waitForSelector('#mobileMenuOverlay.show .close-mobile-menu', { timeout: 5000 });
    await page.click('#mobileMenuOverlay.show .close-mobile-menu');

    // Wait for overlay to disappear
    await page.waitForSelector('#mobileMenuOverlay.show', { state: 'detached', timeout: 5000 });

    // Screenshot after closing mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_mobile_menu_closed.png'));

    return {
      success: true,
      action: "Tested mobile menu navigation: opened menu, navigated to Electronics, closed menu.",
      extractedData: {
        mobileMenuLinks,
        navigatedCategory: categoryHeader
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
